syntax = "proto2";

package com.inbox;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.inbox";
option java_multiple_files = true;
option java_outer_classname = "InboxMsgReadReqProto";

message InboxMsgReadReq {
  optional string id = 1;
  optional int32 moduleId = 2;
  optional int32 status = 3;
}
